import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      friend1: {
        name: "Elvira",
      },
      friend2: {
        name: "Lenara",
      },
      friend3: {
        name: "Vika",
      },
    };
  }

  render() {
    return (
      <div className="App">
        <h1>{this.state.friend1.name}</h1>
      </div>
    );
  }
}

export default App;
